!--------------------------------------------------------------------------------------------
!+
! NAME:
!	LAndI2Lstar
!
! PURPOSE:
!	This subroutine allows to compute magnetic parameters using IGRF+Olson-Pfitzer Quiet
!   magnetic field models. L, I, B, Bo, MLT is computed with the well know make_Lstar of this package
!   whereas L* calculation is empirical and deduced from Lm, I and day of year.
!
! CATEGORY:
!
!
! CALLING SEQUENCE:
!	CALL LAndI2Lstar
!
! INPUTS:
!	None
!
! OUTPUTS:
!	None (in common blocks)
!
! COMMON BLOCKS:
!   COMMON/LAndI2LstarCom/Lmax,Imax,Lupper,Iupper,Lm4,A0,A1,A2,A3,A4,Lm5,A50,A51,A52,A53,A54,A55

!
! MODIFICATION HISTORY:
!	Written by: S. Bourdarie (introduced in version 4.4), May 2009
!-
!--------------------------------------------------------------------------------------------
      SUBROUTINE LAndI2Lstar1(ntime,kext,options,sysaxes,iyearsat,
     &  idoy,UT,xIN1,xIN2,xIN3,maginput,Lm,Lstar,BLOCAL,BMIN,XJ,MLT)
c
      IMPLICIT NONE
      INCLUDE 'variables.inc'
      INCLUDE 'ntime_max.inc'
c
c declare inputs
      INTEGER*4    kext,k_ext,k_l,options(5)
      INTEGER*4    ntime,sysaxes
      INTEGER*4    iyearsat(ntime_max)
      integer*4    idoy(ntime_max)
      real*8     UT(ntime_max)
      real*8     xIN1(ntime_max),xIN2(ntime_max),xIN3(ntime_max)
      real*8     maginput(25,ntime_max)
c                      1: Kp
c                      2: Dst
c                      3: dens
c                      4: velo
c                      5: Pdyn
c                      6: ByIMF
c                      7: BzIMF
c                      8: G1
c                      9: G2
c                     10: G3
c
c Declare internal variables
      INTEGER*4  option1,isat
c
c Declare output variables
      REAL*8     BLOCAL(ntime_max),BMIN(ntime_max),XJ(ntime_max)
      REAL*8     MLT(ntime_max)
      REAL*8     Lm(ntime_max),Lstar(ntime_max)
C
c     This method to compute L* is only available for IGRF + Olson-Pfitzer quiet
      if (options(5) .ne. 0) options(5)=0  ! force internal field to be IGRF
      if (kext .ne. 5) kext=5 ! force external field to be Olson-Pfitzer quiet
c
c     force inputs to use make_lstar but only Lm will be computed (not L* at this point)
      option1=options(1)
      options(1)=0
      call make_lstar1(ntime,kext,options,sysaxes,iyearsat,
     &  idoy,UT,xIN1,xIN2,xIN3,maginput,Lm,Lstar,BLOCAL,BMIN,XJ,MLT)
c
      options(1)=option1
c
c     now compute L* according to fit functions
      call EmpiricalLstar1(ntime,kext,options,iyearsat,idoy,maginput,
     &Lm,XJ,Lstar)
c
      end
c
!--------------------------------------------------------------------------------------------
!+
! NAME:
!	LAndI2Lstar
!
! PURPOSE:
!	This subroutine allows to compute magnetic parameters using IGRF+Olson-Pfitzer Quiet
!   magnetic field models. L, I, B, Bo, MLT is computed with the well know make_Lstar of this package
!   whereas L* calculation is empirical and deduced from Lm, I and day of year.
!
! CATEGORY:
!
!
! CALLING SEQUENCE:
!	CALL LAndI2Lstar
!
! INPUTS:
!	None
!
! OUTPUTS:
!	None (in common blocks)
!
! COMMON BLOCKS:
!   COMMON/LAndI2LstarCom/Lmax,Imax,Lupper,Iupper,Lm4,A0,A1,A2,A3,A4,Lm5,A50,A51,A52,A53,A54,A55

!
! MODIFICATION HISTORY:
!	Written by: S. Bourdarie (introduced in version 4.4), May 2009
!-
!--------------------------------------------------------------------------------------------
      SUBROUTINE LAndI2Lstar_shell_splitting1(ntime,Nipa,kext,options,
     &  sysaxes,iyearsat,idoy,UT,xIN1,xIN2,xIN3,
     &  alpha,maginput,Lm,Lstar,BLOCAL,BMIN,XJ,MLT)
c
      IMPLICIT NONE
      INCLUDE 'variables.inc'
      INCLUDE 'ntime_max.inc'
c
c declare inputs
      INTEGER*4    kext,k_ext,k_l,options(5),Nalp,Nipa
      PARAMETER (Nalp=25)
      INTEGER*4    ntime,sysaxes
      INTEGER*4    iyearsat(ntime_max)
      integer*4    idoy(ntime_max)
      real*8     UT(ntime_max)
      real*8     xIN1(ntime_max),xIN2(ntime_max),xIN3(ntime_max)
      real*8     alpha(Nalp)
      real*8     maginput(25,ntime_max)
c                      1: Kp
c                      2: Dst
c                      3: dens
c                      4: velo
c                      5: Pdyn
c                      6: ByIMF
c                      7: BzIMF
c                      8: G1
c                      9: G2
c                     10: G3
c
c Declare internal variables
      INTEGER*4  option1,isat,IPA,ntime_tmp,sysaxesOUT,sysaxesIN
      REAL*8     BLOCAL_tmp(ntime_max),BMIN_tmp(ntime_max)
      REAL*8     XJ_tmp(ntime_max),MLT_tmp(ntime_max)
      REAL*8     Lm_tmp(ntime_max),Lstar_tmp(ntime_max)
      REAL*8     xIN(3),xOUT(3),BL,BMIR,xGEO(3)
      REAL*8     maginput_tmp(25)
      INTEGER*4  imagin
c
c Declare output variables
      REAL*8     BLOCAL(ntime_max,Nalp),BMIN(ntime_max)
      REAL*8     XJ(ntime_max,Nalp),MLT(ntime_max)
      REAL*8     Lm(ntime_max,Nalp),Lstar(ntime_max,Nalp)
C
c     This method to compute L* is only available for IGRF + Olson-Pfitzer quiet
      if (options(5) .ne. 0) options(5)=0  ! force internal field to be IGRF
      if (kext .ne. 5) kext=5 ! force external field to be Olson-Pfitzer quiet
c
c     force inputs to use make_lstar but only Lm will be computed (not L* at this point)
      option1=options(1)
      options(1)=0
c
c Compute Bmin at all locations first.
      call make_lstar1(ntime,kext,options,sysaxes,iyearsat,
     &  idoy,UT,xIN1,xIN2,xIN3,maginput,Lm_tmp,Lstar_tmp,BLOCAL_tmp,
     &  BMIN,XJ_tmp,MLT)
      ntime_tmp=1
      sysaxesOUT=0
      sysaxesIN=1
      DO isat = 1,ntime
        if (BMIN(isat) .NE. baddata) then
           do imagin = 1,25
              maginput_tmp(imagin) = maginput(isat,imagin)
           enddo
           DO IPA=1,Nipa
              options(1)=0
              if (alpha(IPA).ne.90.0d0) then
                 xIN(1) = xIN1(isat)
                 xIN(2) = xIN2(isat)
                 xIN(3) = xIN3(isat)
                 call coord_trans1(sysaxes,sysaxesOUT,iyearsat(isat),
     &                idoy(isat),UT(isat),xIN,xOUT)
                 CALL find_bm(xOUT(2),xOUT(3),xOUT(1),alpha(IPA),BL,
     &                BMIR,xGEO)
                 call make_lstar1(ntime_tmp,kext,options,sysaxesIN,
     &                iyearsat,idoy,UT,xGEO(1),xGEO(2),xGEO(3),
     &                maginput_tmp,Lm_tmp,Lstar_tmp,BLOCAL_tmp,BMIN_tmp,
     &                XJ_tmp,MLT_tmp)
              ELSE
                 call make_lstar1(ntime_tmp,kext,options,sysaxes,
     &                iyearsat(isat),idoy(isat),UT(isat),xIN1(isat),
     &                xIN2(isat),xIN3(isat),maginput_tmp,
     &                Lm_tmp,Lstar_tmp,BLOCAL_tmp,BMIN_tmp,XJ_tmp,
     &                MLT_tmp)
              ENDIF
              Lm(isat,IPA)=Lm_tmp(1)
              XJ(isat,IPA)=XJ_tmp(1)
              BLOCAL(isat,IPA)=BLOCAL_tmp(1)
              options(1)=option1
c
c     now compute L* according to fit functions
              call EmpiricalLstar1(ntime_tmp,kext,options,
     &             iyearsat(isat),idoy(isat),
     &             maginput_tmp,Lm_tmp,XJ_tmp,Lstar_tmp)
              Lstar(isat,IPA)=Lstar_tmp(1)
           enddo
	else
	  DO IPA=1,Nipa
	    Lm(isat,IPA)=baddata
	    Lstar(isat,IPA)=baddata
	    XJ(isat,IPA)=baddata
	    BLOCAL(isat,IPA)=baddata
	  enddo
	endif
      enddo
c
      options(1)=option1
c
      end
c
!--------------------------------------------------------------------------------------------
!+
! NAME:
!	EmpiricalLstar
!
! PURPOSE:
!	This subroutine allows to L* with IGRF+Olson-Pfitzer Quiet
!   magnetic field models. The calculation is empirical from tables (Bourdarie)
!
! CATEGORY:
!
!
! CALLING SEQUENCE:
!	CALL EmpiricalLstar
!
! INPUTS:
!	ntime: number of time steps to be computed
!   kext: index of external field model being used (May 2009 only Olson-Pfitzer Quiet is available)
!   options:
!   iyearsat: year (integer)
!   idoy: day of year (1=1st of January)
!   maginput: drivers for external magnetic fields
!   Lm: McIlwain L
!   XJ: I
!
! OUTPUTS:
!	Lstar: L*
!
! COMMON BLOCKS:
!   COMMON/LAndI2LstarCom/Lmax,Imax,Lupper,Iupper,Lm4,A0,A1,A2,A3,A4,Lm5,A50,A51,A52,A53,A54,A55
!   COMMON /dipigrf/Bo,xc,yc,zc,ct,st,cp,sp
!
!
! MODIFICATION HISTORY:
!	Written by: S. Bourdarie (introduced in version 4.4), May 2009
!-
!--------------------------------------------------------------------------------------------
      SUBROUTINE EmpiricalLstar1(ntime,kext,options,iyearsat,idoy,
     &maginput,Lm,XJ,Lstar)
c
      IMPLICIT NONE
      INCLUDE 'variables.inc'
      INCLUDE 'ntime_max.inc'
c
c declare inputs
      INTEGER*4    kext,options(5)
      INTEGER*4    ntime
      INTEGER*4    iyearsat(ntime_max)
      integer*4    idoy(ntime_max)
      real*8     maginput(25,ntime_max)
c                      1: Kp
c                      2: Dst
c                      3: dens
c                      4: velo
c                      5: Pdyn
c                      6: ByIMF
c                      7: BzIMF
c                      8: G1
c                      9: G2
c                     10: G3
c
      REAL*8     XJ(ntime_max),Lm(ntime_max)
c
c Declare internal variables
      INTEGER*4  isat,DayIndexL,DayIndexR,i,iflag,iyear,kint
      INTEGER*4  firstJanuary,lastDecember,currentdoy,JULDAY
      REAL*8     Lmax(12,2100),Imax(12,2100)
      REAL*8     Lupper(12,1001),Iupper(12,1001)
      REAL*8     Lm4(12,100),A0(12,100),A1(12,100),A2(12,100),A3(12,100)
      REAL*8     A4(12,100)
      REAL*8     Lm5(12,100),A50(12,100),A51(12,100),A52(12,100)
      REAL*8     A53(12,100),A54(12,100),A55(12,100)
      REAL*8     slope,origin,XJL,XJR,LupperL,LupperR,Lstar1,Lstar2
      REAL*8     LstarL,LstarR,LnXJ,XJatLossCone
      REAL*8     Bo,xc,yc,zc,ct,st,cp,sp
      REAL*8     pi,dec_year
      REAL*8     DeltaT
c
c Declare output variables
      REAL*8     Lstar(ntime_max)
C
      COMMON/LAndI2LstarCom/Lmax,Imax,Lupper,Iupper,Lm4,A0,A1,A2,A3,A4,
     &Lm5,A50,A51,A52,A53,A54,A55
      COMMON /dipigrf/Bo,xc,yc,zc,ct,st,cp,sp
c
c     This method to compute L* is only available for IGRF + Olson-Pfitzer quiet
      if (options(5) .ne. 0) options(5)=0  ! force internal field to be IGRF
      if (kext .ne. 5) kext=5 ! force external field to be Olson-Pfitzer quiet
c
c     now compute L* according to fit functions
      CALL InitLAndI2Lstar_OlsonPfitzerQuiet
      Iflag=0
      DO isat = 1,ntime
        DayIndexL=idoy(isat)/30+1
        DayIndexR=DayIndexL+1
        if (DayIndexL .gt. 12) DayIndexL=12
        if (DayIndexR .gt. 12) DayIndexR=1
        DeltaT=30.D0
        if (DayIndexL .eq. 12 .and. DayIndexR .eq. 1) DeltaT=35.D0
        if (XJ(isat) .lt. 0.D0) then
          Lstar(isat)=baddata
          goto 900
        endif
c       check first if point is in the loss cone
        if (Lm(isat) .lt. 0.D0 .and. Lm(isat) .ne. baddata) then
	  iflag=-1
	  Lm(isat)=-Lm(isat)
	endif
        if (Lm(isat) .lt. Lmax(DayIndexL,1)) then
	  !iflag=1
          !Lstar(isat)=baddata
          !goto 900
	  iflag=-3
          XJatLossCone=XJ(isat)
	  XJ(isat)=Imax(DayIndexL,1)
	  goto 200
        endif
        if (Lm(isat) .lt. Lmax(DayIndexR,1)) then
	  !iflag=2
          !Lstar(isat)=baddata
          !goto 900
	  iflag=-3
          XJatLossCone=XJ(isat)
	  XJ(isat)=Imax(DayIndexR,1)
	  goto 200
        endif
        if (Lm(isat) .gt. Lmax(DayIndexL,2100)) goto 200
        if (Lm(isat) .gt. Lmax(DayIndexR,2100)) goto 200
        do i=2,2100
          if (Lmax(DayIndexL,i) .ge. Lm(isat)) goto 100
        enddo
100     continue
        slope=(LOG(Imax(DayIndexL,i))-LOG(Imax(DayIndexL,i-1)))/
     &        (Lmax(DayIndexL,i)-Lmax(DayIndexL,i-1))
        origin=LOG(Imax(DayIndexL,i))-Lmax(DayIndexL,i)*slope
        XJL=EXP(slope*Lm(isat)+origin)
        do i=2,2100
          if (Lmax(DayIndexR,i) .ge. Lm(isat)) goto 110
        enddo
110     continue
        slope=(LOG(Imax(DayIndexR,i))-LOG(Imax(DayIndexR,i-1)))/
     &        (Lmax(DayIndexR,i)-Lmax(DayIndexR,i-1))
        origin=LOG(Imax(DayIndexR,i))-Lmax(DayIndexR,i)*slope
        XJR=EXP(slope*Lm(isat)+origin)
c        slope=(XJR-XJL)/30.D0
c        origin=XJL-((idoy(isat)/30)*30.d0+1.d0)*slope
        slope=(XJR-XJL)/DeltaT
        origin=XJL-((DayIndexL-1)*30.d0+1.d0)*slope
c
        if (XJ(isat) .gt. slope*idoy(isat)+origin) then ! point is in the loss cone
          if (iflag .eq. 0) iflag=3
          if (iflag .eq. -1) iflag=-3
          XJatLossCone=XJ(isat)
	  ! set XJ(isat) to the value at the loss cone limit to compute L* anyway.
	  ! so L* will be the same as the one at the loss cone limit even if
	  ! location is in the loss cone. Finnally L* will set to -L*.
	  ! a negative value will indicate "in the loss cone" i.e. non trapped
	  XJ(isat)=slope*idoy(isat)+origin
c	  Lstar(isat)=baddata
c          goto 900
        endif
200     continue
c       next check if point is outside close drift shell zone
        do i=2,1001
          if (Iupper(DayIndexL,i) .ge. XJ(isat)) goto 300
        enddo
300     continue
        if (i .gt. 1001) then ! point is outside close drift shell zone
          iflag=4
          Lstar(isat)=baddata
          goto 900
        endif
        slope=(Lupper(DayIndexL,i)-Lupper(DayIndexL,i-1))/
     &        (Iupper(DayIndexL,i)-Iupper(DayIndexL,i-1))
        origin=Lupper(DayIndexL,i)-slope*Iupper(DayIndexL,i)
        LupperL=slope*XJ(isat)+origin
        if (Lm(isat) .gt. LupperL) then ! point is outside close drift shell zone
          iflag=4
          Lstar(isat)=baddata
          goto 900
        endif
c
        do i=2,1001
          if (Iupper(DayIndexR,i) .ge. XJ(isat)) goto 310
        enddo
310     continue
        if (i .gt. 1001) then ! point is outside close drift shell zone
          iflag=4
          Lstar(isat)=baddata
          goto 900
        endif
        slope=(Lupper(DayIndexR,i)-Lupper(DayIndexR,i-1))/
     &        (Iupper(DayIndexR,i)-Iupper(DayIndexR,i-1))
        origin=Lupper(DayIndexR,i)-slope*Iupper(DayIndexR,i)
        LupperR=slope*XJ(isat)+origin
        if (Lm(isat) .gt. LupperR) then ! point is outside close drift shell zone
          iflag=4
          Lstar(isat)=baddata
          goto 900
        endif
c        slope=(LupperR-LupperL)/30.D0
c        origin=LupperL-(idoy(isat)/31)*slope
c        if (Lm(isat) .gt. slope*idoy(isat)+origin) then ! point is outside close drift shell zone
c          iflag=4
c          Lstar(isat)=baddata
c          goto 900
c        endif
c
c       Finally compute L* according to fit functions
        LnXJ=LOG(XJ(isat))
        if (XJ(isat) .LT. 0.0001) LnXJ=LOG(0.0001)
        if (Lm(isat) .gt. 7.5D0 .and. XJ(isat) .gt. 1.D0) then
          if (Lm(isat) .gt. 7.5D0 .and. Lm(isat) .le. 7.6D0) then
            i=1
            Lstar1=A50(DayIndexL,i)+A51(DayIndexL,i)*LnXJ+
     &      A52(DayIndexL,i)*LnXJ*LnXJ+
     &      A53(DayIndexL,i)*LnXJ*LnXJ*LnXJ+
     &      A54(DayIndexL,i)*LnXJ*LnXJ*LnXJ*LnXJ+
     &      A55(DayIndexL,i)*LnXJ*LnXJ*LnXJ*LnXJ*LnXJ
            if (A50(DayIndexL,i) .lt. -9.D30) Lstar1=baddata
            do i=2,99
              if (Lm4(DayIndexL,i+1) .eq. 0.D0) goto 350
              if (Lm4(DayIndexL,i) .ge. Lm(isat)) goto 350
            enddo
350         continue
            Lstar2=A0(DayIndexL,i-1)+A1(DayIndexL,i-1)*LnXJ+
     &      A2(DayIndexL,i-1)*LnXJ*LnXJ+
     &      A3(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ+
     &      A4(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ*LnXJ
            if (A0(DayIndexL,i-1) .lt. -9.D30) Lstar2=baddata
            if (Lstar1 .eq. baddata .or. Lstar2 .eq. baddata) then
              LstarL=baddata
            else
              slope=(Lstar1-Lstar2)/
     &               (Lm5(DayIndexL,1)-Lm4(DayIndexL,i-1))
              origin=Lstar1-slope*Lm5(DayIndexL,1)
              LstarL=slope*Lm(isat)+origin
            endif
            i=1
            Lstar1=A50(DayIndexR,i)+A51(DayIndexR,i)*LnXJ+
     &      A52(DayIndexR,i)*LnXJ*LnXJ+
     &      A53(DayIndexR,i)*LnXJ*LnXJ*LnXJ+
     &      A54(DayIndexR,i)*LnXJ*LnXJ*LnXJ*LnXJ+
     &      A55(DayIndexR,i)*LnXJ*LnXJ*LnXJ*LnXJ*LnXJ
            if (A50(DayIndexR,i) .lt. -9.D30) Lstar1=baddata
            do i=2,99
              if (Lm4(DayIndexR,i+1) .eq. 0.D0) goto 360
              if (Lm4(DayIndexR,i) .ge. Lm(isat)) goto 360
            enddo
360         continue
            Lstar2=A0(DayIndexR,i-1)+A1(DayIndexR,i-1)*LnXJ+
     &      A2(DayIndexR,i-1)*LnXJ*LnXJ+
     &      A3(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ+
     &      A4(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ*LnXJ
            if (A0(DayIndexR,i-1) .lt. -9.D30) Lstar2=baddata
            if (Lstar1 .eq. baddata .or. Lstar2 .eq. baddata) then
              LstarR=baddata
            else
              slope=(Lstar1-Lstar2)/
     &               (Lm5(DayIndexR,1)-Lm4(DayIndexR,i-1))
              origin=Lstar1-slope*Lm5(DayIndexR,1)
              LstarR=slope*Lm(isat)+origin
            endif
          else
            do i=2,99
              if (Lm5(DayIndexL,i+1) .eq. 0.D0) goto 400
              if (Lm5(DayIndexL,i) .ge. Lm(isat)) goto 400
            enddo
400         continue
            Lstar1=A50(DayIndexL,i)+A51(DayIndexL,i)*LnXJ+
     &      A52(DayIndexL,i)*LnXJ*LnXJ+
     &      A53(DayIndexL,i)*LnXJ*LnXJ*LnXJ+
     &      A54(DayIndexL,i)*LnXJ*LnXJ*LnXJ*LnXJ+
     &      A55(DayIndexL,i)*LnXJ*LnXJ*LnXJ*LnXJ*LnXJ
            if (A50(DayIndexL,i) .lt. -9.D30) Lstar1=baddata
            Lstar2=A50(DayIndexL,i-1)+A51(DayIndexL,i-1)*LnXJ+
     &      A52(DayIndexL,i-1)*LnXJ*LnXJ+
     &      A53(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ+
     &      A54(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ*LnXJ+
     &      A55(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ*LnXJ*LnXJ
            if (A50(DayIndexL,i-1) .lt. -9.D30) Lstar1=baddata
            if (Lstar1 .eq. baddata .or. Lstar2 .eq. baddata) then
              LstarL=baddata
            else
              slope=(Lstar1-Lstar2)/
     &               (Lm5(DayIndexL,i)-Lm5(DayIndexL,i-1))
              origin=Lstar1-slope*Lm5(DayIndexL,i)
              LstarL=slope*Lm(isat)+origin
            endif

            do i=2,99
              if (Lm5(DayIndexR,i+1) .eq. 0.D0) goto 500
              if (Lm5(DayIndexR,i) .ge. Lm(isat)) goto 500
            enddo
500         continue
            Lstar1=A50(DayIndexR,i)+A51(DayIndexR,i)*LnXJ+
     &      A52(DayIndexR,i)*LnXJ*LnXJ+
     &      A53(DayIndexR,i)*LnXJ*LnXJ*LnXJ+
     &      A54(DayIndexR,i)*LnXJ*LnXJ*LnXJ*LnXJ+
     &      A55(DayIndexR,i)*LnXJ*LnXJ*LnXJ*LnXJ*LnXJ
            if (A50(DayIndexR,i) .lt. -9.D30) Lstar1=baddata
            Lstar2=A50(DayIndexR,i-1)+A51(DayIndexR,i-1)*LnXJ+
     &      A52(DayIndexR,i-1)*LnXJ*LnXJ+
     &      A53(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ+
     &      A54(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ*LnXJ+
     &      A55(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ*LnXJ*LnXJ
            if (A50(DayIndexR,i-1) .lt. -9.D30) Lstar2=baddata
            if (Lstar1 .eq. baddata .or. Lstar2 .eq. baddata) then
              LstarR=baddata
            else
              slope=(Lstar1-Lstar2)/
     &              (Lm5(DayIndexR,i)-Lm5(DayIndexR,i-1))
              origin=Lstar1-slope*Lm5(DayIndexR,i)
              LstarR=slope*Lm(isat)+origin
            endif
          endif
        else
          do i=2,99
            !if (Lm4(DayIndexL,i+1) .eq. 0.D0) goto 600
            if (Lm4(DayIndexL,i) .eq. 0.D0) goto 600
            if (Lm4(DayIndexL,i) .ge. Lm(isat)) goto 600
          enddo
600       continue
          Lstar1=A0(DayIndexL,i)+A1(DayIndexL,i)*LnXJ+
     &    A2(DayIndexL,i)*LnXJ*LnXJ+
     &    A3(DayIndexL,i)*LnXJ*LnXJ*LnXJ+
     &    A4(DayIndexL,i)*LnXJ*LnXJ*LnXJ*LnXJ
          if (A0(DayIndexL,i) .lt. -9.D30) Lstar1=baddata
          Lstar2=A0(DayIndexL,i-1)+A1(DayIndexL,i-1)*LnXJ+
     &    A2(DayIndexL,i-1)*LnXJ*LnXJ+
     &    A3(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ+
     &    A4(DayIndexL,i-1)*LnXJ*LnXJ*LnXJ*LnXJ
          if (A0(DayIndexL,i-1) .lt. -9.D30) Lstar2=baddata
          if (Lstar1 .eq. baddata .or. Lstar2 .eq. baddata) then
            LstarL=baddata
          else
            slope=(Lstar1-Lstar2)/(Lm4(DayIndexL,i)-Lm4(DayIndexL,i-1))
            origin=Lstar1-slope*Lm4(DayIndexL,i)
            LstarL=slope*Lm(isat)+origin
          endif

          do i=2,100
            if (Lm4(DayIndexR,i) .eq. 0.D0) goto 700
            if (Lm4(DayIndexR,i) .ge. Lm(isat)) goto 700
          enddo
700       continue
          Lstar1=A0(DayIndexR,i)+A1(DayIndexR,i)*LnXJ+
     &    A2(DayIndexR,i)*LnXJ*LnXJ+
     &    A3(DayIndexR,i)*LnXJ*LnXJ*LnXJ+
     &    A4(DayIndexR,i)*LnXJ*LnXJ*LnXJ*LnXJ
          if (A0(DayIndexR,i) .lt. -9.D30) Lstar1=baddata
          Lstar2=A0(DayIndexR,i-1)+A1(DayIndexR,i-1)*LnXJ+
     &    A2(DayIndexR,i-1)*LnXJ*LnXJ+
     &    A3(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ+
     &    A4(DayIndexR,i-1)*LnXJ*LnXJ*LnXJ*LnXJ
          if (A0(DayIndexR,i-1) .lt. -9.D30) Lstar2=baddata
          if (Lstar1 .eq. baddata .or. Lstar2 .eq. baddata) then
            LstarR=baddata
          else
            slope=(Lstar1-Lstar2)/(Lm4(DayIndexR,i)-Lm4(DayIndexR,i-1))
            origin=Lstar1-slope*Lm4(DayIndexR,i)
            LstarR=slope*Lm(isat)+origin
          endif
        endif
        if (LstarR .eq. baddata .or. LstarL .eq. baddata) then
          Lstar(isat)=baddata
          if (iflag .eq. 3) Lstar(isat)=-baddata
          if (iflag .eq. -3) Lstar(isat)=-baddata
          if (iflag .eq. -1) Lstar(isat)=-baddata
        else
c          slope=(LstarR-LstarL)/30.D0
c          origin=LstarL-((idoy(isat)/30)*30.d0+1.d0)*slope
          slope=(LstarR-LstarL)/DeltaT
          origin=LstarL-((DayIndexL-1)*30.d0+1.d0)*slope
          Lstar(isat)=slope*idoy(isat)+origin
        endif
        if (iflag .eq. 3) then
          Lstar(isat)=-Lstar(isat)
          XJ(isat)=XJatLossCone
        endif
        if (iflag .eq. -3) then
          Lm(isat)=-Lm(isat)
          Lstar(isat)=-Lstar(isat)
          XJ(isat)=XJatLossCone
        endif
        if (iflag .eq. -1) then
          Lm(isat)=-Lm(isat)
          Lstar(isat)=-Lstar(isat)
        endif
900     continue
        iflag=0
!	if (Lm(isat).gt. 1.12D0 .AND. Lm(isat).LT. 1.125D0) then
!	   write(6,*)iflag,isat,Lstar(isat)
!	endif
      enddo

c
c
c if required by user compute Phi instead of L*
      if (options(1) .EQ. 2) then
        pi=4.D0*atan(1.D0)
        iyear=1800
	kint=options(5)
	IF (kint .lt. 0) THEN
	   kint=0
	   WRITE(6,*)
	   WRITE(6,*)'!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!'
	   WRITE(6,*)'Invalid internal field specification'
	   WRITE(6,*)'Selecting IGRF'
	   WRITE(6,*)'!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!'
	   WRITE(6,*)
	ENDIF
	if (kint .gt. 3) THEN
	   kint=0
	   WRITE(6,*)
	   WRITE(6,*)'!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!'
	   WRITE(6,*)'Invalid internal field specification'
	   WRITE(6,*)'Selecting IGRF'
	   WRITE(6,*)'!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!'
	   WRITE(6,*)
	ENDIF
c
        CALL INITIZE
	if (kint .eq. 2) CALL JensenANDCain1960
	if (kint .eq. 3) CALL GSFC1266
        DO isat = 1,ntime
c	   write(6,*)real(isat)*100./real(ntime), '% done'
c
           if (kint .le. 1) then
              if (options(2) .eq. 0) then
	        if (iyearsat(isat) .ne. iyear) then
	           iyear=iyearsat(isat)
	           dec_year=iyear+0.5d0
	           CALL INIT_DTD(dec_year)
	        endif
	      else
	        if (iyearsat(isat) .ne. iyear .or.
     &          MOD(idoy(isat)*1.d0,options(2)*1.d0) .eq. 0) THEN
	           iyear=iyearsat(isat)
		   firstJanuary=JULDAY(iyear,01,01)
		   lastDecember=JULDAY(iyear,12,31)
		   currentdoy=(idoy(isat)/options(2))*options(2)
		   if (currentdoy .eq. 0) currentdoy=1
	           dec_year=iyear+currentdoy*1.d0/
     &             ((lastDecember-firstJanuary+1)*1.d0)
	           CALL INIT_DTD(dec_year)
                endif
	      endif
	   endif
	   if (Lstar(isat) .NE. baddata) Lstar(isat)=2.d0*pi*Bo/Lstar(isat)
	enddo
      endif

      end

